import React from "react"
import { StoneWrap, Stone, Beach, Whale } from "../styles"

class StoneWhaleBeach extends React.Component {
  render() {
    return (
      <StoneWrap>
        <Stone />
        <Beach />
        <Whale />
      </StoneWrap>
    )
  }
}

export default StoneWhaleBeach
